import { createIcon } from "../icon/createIcon";

export const BarChartIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="BarChartIcon">
    <path d="M0 10h11v1H0v-1z" />
    <path d="M4 5h1v6H4V5zm2-4h1v10H6V1zm2 6h1v4H8V7zm2-3h1v7h-1V4zM0 6h1v5H0V6zm2 2h1v3H2V8z" />
  </svg>,
  "BarChart",
  "bar chart"
);
